method:
  description: 'ChatNoir uses an object storage for random document access to show
    the indexed versions of documents.


    For this, ChatNoir uploads the data to an object storage (S3 at the moment) and
    uses offsets in the uploaded data for random document acccess.

    This step calculates the document offsets and stores them so that the indexing
    step that follows can add the information on how to access a document (i.e., S3
    URL + offsets) into the index.'
  name: 'ChatNoir (Indexer: Document Offsets)'
